import React from 'react';

export const NavigationContainer = styled.div`
  display: flex;
`;

const NavigationLink = styled.a`
  padding: 12px 14px 13px;
  font-weight: 400;
  font-size: 14px;
  color: #fff;
  text-decoration: none;
  transition: all .3s ease;

  &:hover {
    color: #F53B49;
